import React, { useState, useEffect } from 'react';
import { ref, set, get, child } from 'firebase/database';
import { database } from './firebase'; // Import the database
import { PlusOutlined } from '@ant-design/icons';
import { Button, Col, Drawer, Form, Input, Row, Space, Table, Tag, Modal, Select, Layout, Menu } from 'antd';
import { HomeOutlined, TeamOutlined, UnorderedListOutlined } from '@ant-design/icons';
import Home from './Home'; // Import the Home component
import Members from './Members'; // Import the Members component
import Tasks from './Tasks'; // Import the Tasks component

const { Option } = Select;
const { Header, Content, Footer, Sider } = Layout;

const App = () => {
  const [data, setData] = useState([]);
  const [isModalVisible, setIsModalVisible] = useState(false);
  const [currentRecord, setCurrentRecord] = useState(null);
  const [form] = Form.useForm();
  const [open, setOpen] = useState(false);
  const [drawerForm] = Form.useForm();
  const [collapsed, setCollapsed] = useState(false);
  const [selectedMenuItem, setSelectedMenuItem] = useState('home');

  useEffect(() => {
    // Retrieve data from Firebase on component mount
    const fetchData = async () => {
      const dbRef = ref(database);
      const snapshot = await get(child(dbRef, 'accounts'));
      const accounts = snapshot.exists() ? Object.values(snapshot.val()) : [];
      setData(accounts);
    };
    fetchData();
  }, []);

  const showDrawer = () => {
    setOpen(true);
  };

  const onClose = () => {
    setOpen(false);
    drawerForm.resetFields();
  };

  const showEditModal = (record) => {
    setCurrentRecord(record);
    form.setFieldsValue(record);
    setIsModalVisible(true);
  };

  const handleDelete = (key) => {
    const updatedData = data.filter((item) => item.key !== key);
    setData(updatedData);
    set(ref(database, `accounts/${key}`), null);
  };

  const handleOk = () => {
    form
      .validateFields()
      .then((values) => {
        const updatedData = data.map((item) =>
          item.key === currentRecord.key ? { ...item, ...values } : item
        );
        setData(updatedData);
        set(ref(database, `accounts/${currentRecord.key}`), values);
        setIsModalVisible(false);
        setCurrentRecord(null);
        form.resetFields();
      })
      .catch((info) => {
        console.log('Validate Failed:', info);
      });
  };

  const handleCancel = () => {
    setIsModalVisible(false);
    setCurrentRecord(null);
    form.resetFields();
  };

  const handleDrawerSubmit = () => {
    drawerForm
      .validateFields()
      .then((values) => {
        const newData = {
          ...values,
          key: Date.now().toString(), // Use a timestamp as a unique key
          tags: values.tags.split(',').map((tag) => tag.trim()),
        };
        setData([...data, newData]);
        set(ref(database, `accounts/${newData.key}`), newData);
        setOpen(false);
        drawerForm.resetFields();
      })
      .catch((info) => {
        console.log('Validate Failed:', info);
      });
  };

  const handleMenuClick = (e) => {
    setSelectedMenuItem(e.key);
  };

  const renderContent = () => {
    switch (selectedMenuItem) {
      case 'home':
        return <Home />;
      case 'members':
        return <Members data={data} onEdit={showEditModal} onDelete={handleDelete} />;
      case 'tasks':
        return <Tasks />;
      default:
        return <Home />;
    }
  };

  return (
    <Layout style={{ minHeight: '100vh' }}>
      <Sider collapsible collapsed={collapsed} onCollapse={(value) => setCollapsed(value)}>
        <div className="logo" />
        <Menu theme="dark" defaultSelectedKeys={['home']} mode="inline" onClick={handleMenuClick}>
          <Menu.Item key="home" icon={<HomeOutlined />}>
            Home
          </Menu.Item>
          <Menu.Item key="members" icon={<TeamOutlined />}>
            Members
          </Menu.Item>
          <Menu.Item key="tasks" icon={<UnorderedListOutlined />}>
            Tasks
          </Menu.Item>
        </Menu>
      </Sider>
      <Layout className="site-layout">
        <Header className="site-layout-background" style={{ padding: 0 }} />
        <Content style={{ margin: '0 16px' }}>
          {renderContent()}
        </Content>
        <Footer style={{ textAlign: 'center' }}>Craft Club Dashboard Â©2023 Created by Ali</Footer>
      </Layout>
    </Layout>
  );
};

export default App;
